WHERE EXISTS (
           SELECT
               entry_no
           FROM
               (
               SELECT
                   entry_no,
                   serial,
                   ROW_NUMBER() OVER(PARTITION BY entry_no ORDER BY serial DESC) AS serialRownum
               FROM
                   ENTRY_HA_TEMP
               WHERE
                   entry_no = #{entryNo}
                   AND (del_flg IS NULL OR del_flg <> '1')
               ) T1
           WHERE serialRownum = 1
           AND ENTRY_HA_TEMP.entry_no = t1.entry_no
           AND ENTRY_HA_TEMP.serial = t1.serial
   )

